import "mocha";
import {expect} from "chai";
import {DiagramClassParser} from "./diagram-class-parser";
import {DiagramEntityFactory} from "../../class/diagram-entity-factory";
import {DiagramEntityType} from "../../class/entity/diagram-entity-type";
import {DiagramElementType} from "../../class/common/diagram-element-type";
import {DiagramAccessModifier} from "../../class/common/diagram-access-modifier";
import {DiagramType} from "../../class/common/diagram-type";

describe("Test text to diagram parser", () => {
    it("Parse attributes", () => {
        const parser = new DiagramClassParser({
            prefixAccessorMap: {
                [DiagramAccessModifier.PRIVATE]: "_",
            },
        });

        expect(parser.parseProperty("name")).to.deep.equal({
            name: "name",
            type: DiagramType.Unknown,
            final: false,
            abstract: false,
            value: undefined,
            defaultValue: undefined,
            static: false,
            access: "PUBLIC",
            optional: false,
            elementType: "PROPERTY",
        });
        expect(parser.parseProperty("age: number")).to.deep.equal({
            name: "age",
            type: DiagramType.Number,
            final: false,
            abstract: false,
            value: undefined,
            defaultValue: undefined,
            static: false,
            access: "PUBLIC",
            optional: false,
            elementType: "PROPERTY",
        });
        expect(parser.parseProperty("readonly surname;")).to.deep.equal({
            name: "surname",
            type: DiagramType.Unknown,
            final: true,
            abstract: false,
            value: undefined,
            defaultValue: undefined,
            static: false,
            access: "PUBLIC",
            optional: false,
            elementType: "PROPERTY",
        });
        expect(parser.parseProperty("favouriteNumbers: number[]")).to.deep.equal({
            name: "favouriteNumbers",
            type: DiagramType.NumberArray,
            final: false,
            abstract: false,
            value: undefined,
            defaultValue: undefined,
            static: false,
            access: "PUBLIC",
            optional: false,
            elementType: "PROPERTY",
        });
        expect(parser.parseProperty("nickNames:string[];")).to.deep.equal({
            name: "nickNames",
            type: DiagramType.StringArray,
            final: false,
            abstract: false,
            value: undefined,
            defaultValue: undefined,
            static: false,
            access: "PUBLIC",
            optional: false,
            elementType: "PROPERTY",
        });
        expect(parser.parseProperty("gender: string = 'UNKNOWN'")).to.deep.equal({
            name: "gender",
            type: DiagramType.String,
            final: false,
            abstract: false,
            value: "'UNKNOWN'",
            defaultValue: "'UNKNOWN'",
            static: false,
            access: "PUBLIC",
            optional: false,
            elementType: "PROPERTY",
        });
        expect(parser.parseProperty("middleName?:string")).to.deep.equal({
            name: "middleName",
            type: DiagramType.String,
            final: false,
            abstract: false,
            value: undefined,
            defaultValue: undefined,
            static: false,
            access: "PUBLIC",
            optional: true,
            elementType: "PROPERTY",
        });
        expect(parser.parseProperty("alias ? :string = 'none'")).to.deep.equal({
            name: "alias",
            type: DiagramType.String,
            final: false,
            abstract: false,
            value: "'none'",
            defaultValue: "'none'",
            static: false,
            access: "PUBLIC",
            optional: true,
            elementType: "PROPERTY",
        });
        expect(parser.parseProperty("protected favouriteLetter = 'g'")).to.deep.equal({
            name: "favouriteLetter",
            type: DiagramType.Unknown,
            final: false,
            abstract: false,
            value: "'g'",
            defaultValue: "'g'",
            static: false,
            access: DiagramAccessModifier.PROTECTED,
            optional: false,
            elementType: "PROPERTY",
        });
    });
    it("Parse methods", () => {
        const parser = new DiagramClassParser({
            prefixAccessorMap: {
                [DiagramAccessModifier.PRIVATE]: "_",
            },
        });

        expect(parser.parseMethod("toString()")).to.deep.equal({
            name: "toString",
            returnType: DiagramType.Unknown,
            final: false,
            abstract: false,
            static: false,
            access: DiagramAccessModifier.PUBLIC,
            parameters: undefined,
            elementType: DiagramElementType.METHOD,
        });

        expect(parser.parseMethod("public getName(): string")).to.deep.equal({
            name: "getName",
            returnType: DiagramType.String,
            final: false,
            abstract: false,
            static: false,
            access: DiagramAccessModifier.PUBLIC,
            parameters: undefined,
            elementType: DiagramElementType.METHOD,
        });

        expect(parser.parseMethod("protected setName(name: string): void")).to.deep.equal({
            name: "setName",
            returnType: DiagramType.Void,
            final: false,
            abstract: false,
            static: false,
            access: DiagramAccessModifier.PROTECTED,
            parameters: [
                {
                    defaultValue: undefined,
                    index: 0,
                    name: "name",
                    optional: false,
                    type: DiagramType.String,
                },
            ],
            elementType: DiagramElementType.METHOD,
        });
        expect(parser.parseMethod("private getNick(defaultNick?: string): string[]")).to.deep.equal({
            name: "getNick",
            returnType: DiagramType.StringArray,
            final: false,
            abstract: false,
            static: false,
            access: DiagramAccessModifier.PRIVATE,
            parameters: [
                {
                    defaultValue: undefined,
                    index: 0,
                    name: "defaultNick",
                    optional: true,
                    type: DiagramType.String,
                },
            ],
            elementType: DiagramElementType.METHOD,
        });

        expect(parser.parseMethod("private introduce(toConsole: string = 'yes'): string")).to.deep.equal({
            name: "introduce",
            returnType: DiagramType.String,
            final: false,
            abstract: false,
            static: false,
            access: DiagramAccessModifier.PRIVATE,
            parameters: [
                {
                    defaultValue: "'yes'",
                    index: 0,
                    name: "toConsole",
                    optional: true,
                    type: DiagramType.String,
                },
            ],
            elementType: DiagramElementType.METHOD,
        });

        expect(parser.parseMethod("public sum(valueA: number, valueB: number, valueC?: number): number")).to.deep.equal({
            name: "sum",
            returnType: DiagramType.Number,
            final: false,
            abstract: false,
            static: false,
            access: DiagramAccessModifier.PUBLIC,
            parameters: [
                {
                    defaultValue: undefined,
                    index: 0,
                    name: "valueA",
                    optional: false,
                    type: DiagramType.Number,
                },
                {
                    defaultValue: undefined,
                    index: 1,
                    name: "valueB",
                    optional: false,
                    type: DiagramType.Number,
                },
                {
                    defaultValue: undefined,
                    index: 2,
                    name: "valueC",
                    optional: true,
                    type: DiagramType.Number,
                },
            ],
            elementType: DiagramElementType.METHOD,
        });
    });
    it("Parse basic class", () => {
        const parser = new DiagramClassParser();
        const {type, bodyRows, name} = parser.parseEntityBasic("class Person {}");

        expect(type).to.be.equal(DiagramEntityType.CLASS);

        const factory = DiagramEntityFactory.createClass(name);
        parser.parseClassBody(bodyRows, factory);
        const parsedDiagram = factory.build();

        expect(parsedDiagram.elementType).to.be.equal(DiagramElementType.ENTITY);
        expect(parsedDiagram.name).to.be.equal("Person");
        expect(parsedDiagram.access).to.be.equal(DiagramAccessModifier.PUBLIC);
        expect(parsedDiagram.type).to.be.equal(DiagramEntityType.CLASS);
    });
});

import {DiagramEntityParser} from "./diagram-entity-parser";
import {ClassDiagramParserOptions} from "./class-diagram-parser-options";
import {DiagramEntityFactory} from "../../class/diagram-entity-factory";
import {DiagramEntity} from "../../class/entity/diagram-entity";
import {DiagramType, ParseDiagramType} from "../../class/common/diagram-type";
import {DiagramMethodParameter} from "../../class/method/diagram-method-parameter";
import {DiagramMethod} from "../../class/method/diagram-method";
import {DiagramProperty} from "../../class/property/diagram-property";
import {DiagramElementType} from "../../class/common/diagram-element-type";

export class DiagramClassParser extends DiagramEntityParser {
    public parseClassBody(bodyActiveRows: string[], factory: DiagramEntityFactory<DiagramEntity>): void {
        bodyActiveRows.forEach((row) => {
            const isMethod = row.match(/\(.*\)/);

            if (isMethod) {
                return factory.addMethodRaw(this.parseMethod(row));
            }
            factory.addPropertyRaw(this.parseProperty(row));
        });
    }

    private getMethodAndReturnTypeFromMethod(content: string): { method: string, returnType?: string } {
        const lastIndexOfTypeDivider = content.lastIndexOf(":");

        if (lastIndexOfTypeDivider < 0) {
            return {method: content, returnType: undefined};
        }

        return {
            method: content.substr(0, lastIndexOfTypeDivider),
            returnType: content.substring(lastIndexOfTypeDivider + 1).trim(),
        };
    }

    public parseMethod(content: string): DiagramMethod {
        const params = content.match(/\((.|\n)*\)/);

        const {method, returnType} = this.getMethodAndReturnTypeFromMethod(content);

        const tokens = method.replace(/\((.|\n)*\)/g, "").trim().split(" ");

        const modifiers = this.parseModifiersFromToken(tokens, this.options);
        const rawName = tokens[tokens.length - 1];
        const name = rawName;

        const trimmedReturnType = returnType?.trim();

        return {
            name,
            abstract: modifiers.abstract,
            final: modifiers.final,
            elementType: DiagramElementType.METHOD,
            access: modifiers.accessor,
            static: modifiers.static,
            returnType: trimmedReturnType ? ParseDiagramType(trimmedReturnType) : DiagramType.Unknown,
            parameters: params ? params[0].match(/\(\W*\)/) ? undefined : this.getMethodParams(params[0].trim(), this.options) : undefined,
        };
    }

    /**
     * TODO: determine type from default value
     */
    public parseProperty(content: string): DiagramProperty {
        const [data, defaultValue] = content.split("=");
        const [info, rawType] = data.split(":");
        const type = ParseDiagramType(rawType);

        const infoTokens = info.trim().split(" ");

        let optional = false;
        // check 'name ?: string' or 'age ? :number'
        if (infoTokens[infoTokens.length - 1].endsWith("?")) {
            const lastToken = infoTokens[infoTokens.length - 1];
            if (lastToken === "?") {
                infoTokens.pop();
            } else {
                infoTokens[infoTokens.length - 1] = lastToken.substring(0, lastToken.length - 1);
            }
            optional = true;
        }

        // TODO: check accessorPrefix
        const rawName = infoTokens[infoTokens.length - 1].replace(/[;]/g, "");
        const name = rawName;

        const modifiers = this.parseModifiersFromToken(infoTokens, this.options);
        const trimmedDefaultValue = defaultValue?.trim();

        return {
            name,
            optional,
            type,
            defaultValue: trimmedDefaultValue,
            final: modifiers.final,
            abstract: modifiers.abstract,
            static: modifiers.static,
            access: modifiers.accessor,
            value: trimmedDefaultValue,
            elementType: DiagramElementType.PROPERTY,
        };
    }

    /**
     * @param params - `^(.*)$`
     * @param options - options to parse params
     * @private
     */
    private getMethodParams(params: string, options: ClassDiagramParserOptions): DiagramMethodParameter[] {
        const cleanedParams = params.substring(1, params.length - 1);

        return cleanedParams.split(",").map((param, index) => {
            const trimmedParams = param.trim();
            const propertyData = this.parseProperty(trimmedParams);

            return {
                index,
                name: propertyData.name,
                type: propertyData.type,
                defaultValue: propertyData.defaultValue,
                optional: propertyData.optional || propertyData.defaultValue !== undefined,
            };
        });
    }
}

import {DiagramAbstractParser} from "./diagram-abstract-parser";
import {ClassDiagramParserOptions} from "./class-diagram-parser-options";
import {DiagramAccessModifier} from "../../class/common/diagram-access-modifier";
import {DiagramEntityType, ParseDiagramEntityType} from "../../class/entity/diagram-entity-type";
import {DiagramEntityFactory} from "../../class/diagram-entity-factory";
import {DiagramEntity} from "../../class/entity/diagram-entity";

export class DiagramEntityParser extends DiagramAbstractParser {
    public constructor(options: Partial<ClassDiagramParserOptions> = {}) {
        super({
            defaultAccessModifier: options.defaultAccessModifier ?? DiagramAccessModifier.PUBLIC,
            entityDivider: options.entityDivider ?? "--",
        } as ClassDiagramParserOptions);
    }

    public parseImplements(rawImplements: string, factory: DiagramEntityFactory<DiagramEntity>): void {
        const trimmedImplements = rawImplements?.trim();
        if (!trimmedImplements) {
            return;
        }

        const implementsTokens = trimmedImplements.split(",");

        implementsTokens.forEach((implementsToken) => {
            const trimmedImplementsToken = implementsToken.trim();
            if (!trimmedImplementsToken) {
                return;
            }

            if (!trimmedImplementsToken.match(/[<>]/)) {
                return factory.addParentImplements(trimmedImplementsToken);
            }

            throw new Error("Parsing of generic interfaces are not implemented");
        });
    }

    public parseExtends(rawExtends: string, factory: DiagramEntityFactory<DiagramEntity>): void {
        const trimmedExtends = rawExtends?.trim();
        if (trimmedExtends) {
            factory.setParentExtends(trimmedExtends);
        }
    }

    public parseEntityBasic(content: string): {
        type: DiagramEntityType,
        bodyRows: string[],
        rawExtends: string,
        rawImplements: string,
        modifiers: any,
        name: string,
    } {
        const bodyStartIndex = content.indexOf("{");
        const bodyEndIndex = content.indexOf("}", bodyStartIndex + 1);
        const header = content.substr(0, bodyStartIndex);
        const body = content.substring(bodyStartIndex + 1, bodyEndIndex);

        const [tmpHeader, rawImplements] = header.split("implements");
        const [mainHeader, rawExtends] = tmpHeader.split("extends");

        // TODO: process rest;

        const headerTokens = mainHeader.trim().split(" ");

        const name = headerTokens[headerTokens.length - 1];
        const rawType = headerTokens[headerTokens.length - 2];


        const type = ParseDiagramEntityType(rawType);
        if (!type) {
            throw new Error("Cannot parse type " + rawType);
        }
        const modifiers = this.parseModifiersFromToken(headerTokens, this.options);
        const bodyRows = body.replace(/\/\*(.|\n)*?\*\\/g, "").split("\n").map((e) => e.trim()).filter((e) => !!e);

        return {type, name, modifiers, bodyRows, rawImplements, rawExtends};
    }
}

import {ClassDiagramParserOptions} from "./class-diagram-parser-options";
import {DiagramAccessModifier} from "../../class/common/diagram-access-modifier";

/**
 * type PersonId = string
 * -
 * abstract class AbstractPerson {
 *     public readonly id: PersonId
 *     #name: string
 *     alive = true
 *     age: number = 0
 *
 *     public setName(name: string): void
 * }
 */
export abstract class DiagramAbstractParser {
    protected constructor(protected readonly options: ClassDiagramParserOptions) {
    }

    protected parseModifiersFromToken(tokens: string[], options: ClassDiagramParserOptions): {
        readonly accessor: DiagramAccessModifier;
        readonly static: boolean;
        readonly abstract: boolean;
        readonly final: boolean;
    } {
        const defaultModifiers = {
            accessor: options.defaultAccessModifier,
            static: false,
            abstract: false,
            final: false,
        };

        let haveAccessModifier = false;

        return tokens.reduce((acc, token) => {
            const trimmedToken = token.trim();

            switch (trimmedToken.toLowerCase()) {
                case "private":
                    if (haveAccessModifier) {
                        throw new Error("Cannot apply multiple access modifiers");
                    }
                    haveAccessModifier = true;

                    return Object.assign(acc, {accessor: DiagramAccessModifier.PRIVATE});
                case "public":
                    if (haveAccessModifier) {
                        throw new Error("Cannot apply multiple access modifiers");
                    }
                    haveAccessModifier = true;

                    return Object.assign(acc, {accessor: DiagramAccessModifier.PUBLIC});
                case "protected":
                    if (haveAccessModifier) {
                        throw new Error("Cannot apply multiple access modifiers");
                    }
                    haveAccessModifier = true;

                    return Object.assign(acc, {accessor: DiagramAccessModifier.PROTECTED});
                case "package":
                    if (haveAccessModifier) {
                        throw new Error("Cannot apply multiple access modifiers");
                    }
                    haveAccessModifier = true;

                    return Object.assign(acc, {accessor: DiagramAccessModifier.PACKAGE});
                case "static":
                    return Object.assign(acc, {static: true});
                case "abstract":
                    return Object.assign(acc, {abstract: true});
                case "readonly":
                case "final":
                    return Object.assign(acc, {final: true});
                default:
                    return acc;
            }
        }, defaultModifiers);
    }
}

export enum DiagramAccessModifier {
    PUBLIC = "PUBLIC",
    PROTECTED = "PROTECTED",
    PRIVATE = "PRIVATE",
    PACKAGE = "PACKAGE",
}

export function parseDiagramAccessModifier(param: string): DiagramAccessModifier | null {
    switch (param?.toUpperCase()) {
        case DiagramAccessModifier.PUBLIC:
            return DiagramAccessModifier.PUBLIC;
        case DiagramAccessModifier.PROTECTED:
            return DiagramAccessModifier.PROTECTED;
        case DiagramAccessModifier.PRIVATE:
            return DiagramAccessModifier.PRIVATE;
        case DiagramAccessModifier.PACKAGE:
            return DiagramAccessModifier.PACKAGE;
        default:
            console.warn("Cannot parse DiagramAccessModifier " + param);

            return null;
    }
}

export function DiagramAccessModifierToString(param: DiagramAccessModifier | null | undefined): string {
    switch (param) {
        case DiagramAccessModifier.PACKAGE:
            return "~";
        case DiagramAccessModifier.PRIVATE:
            return "-";
        case DiagramAccessModifier.PUBLIC:
            return "+";
        case DiagramAccessModifier.PROTECTED:
            return "/";
        default:
            console.warn("Cannot parse DiagramAccessModifier " + param);

            return "";

    }
}

/**
 * TODO: add PRIMITIVE, PACKAGE
 */
export enum DiagramEntityType {
    CLASS = "CLASS",
    INTERFACE = "INTERFACE",
    ENUM = "ENUM",
}


export function ParseDiagramEntityType(data: string | null): DiagramEntityType | null {
    switch (data?.trim().toLowerCase()) {
        case "class":
            return DiagramEntityType.CLASS;
        case "enum":
            return DiagramEntityType.ENUM;
        case "interface":
            return DiagramEntityType.INTERFACE;
        default:
            return null;
    }
}

import {DiagramGeneric, DiagramGenericToString} from "./diagram-generic";

export enum DiagramTypeName {
    STRING = "STRING",
    NUMBER = "NUMBER",
    BOOLEAN = "BOOLEAN",
    VOID = "VOID",
    LINK = "LINK",
    UNKNOWN = "UNKNOWN",
    UNION = "UNION",
}

export interface DiagramType {
    readonly name?: string | DiagramTypeName;
    /**
     * Target link name
     */
    readonly className?: string;
    readonly array?: boolean;
    readonly enumValues?: string[];
    readonly generics?: DiagramGeneric[];
}


export const AdvancedDiagramType = {
    Observable: (type: DiagramType): DiagramType => ({
        name: "Observable",
        generics: [{
            name: DiagramTypeToString(type),
        }],
    }),
};

// TODO: add Observable
// tslint:disable-next-line:variable-name
export const DiagramType = {
    String: {name: DiagramTypeName.STRING},
    StringArray: {name: DiagramTypeName.STRING, array: true},
    Number: {name: DiagramTypeName.NUMBER},
    Unknown: {name: DiagramTypeName.UNKNOWN},
    UnknownArray: {name: DiagramTypeName.UNKNOWN, array: true},
    NumberArray: {name: DiagramTypeName.NUMBER, array: true},
    Boolean: {name: DiagramTypeName.BOOLEAN},
    BooleanArray: {name: DiagramTypeName.BOOLEAN, array: true},
    Union: (...enumValues: string[]): DiagramType => ({enumValues, name: DiagramTypeName.UNION}),
    Void: {name: DiagramTypeName.VOID},

    /**
     * Link to entity
     * @param targetName - entity name
     */
    Link: (targetName: string): DiagramType => ({name: DiagramTypeName.LINK, className: targetName}),
    LinkGeneric: (targetName: string, ...generics: DiagramGeneric[]): DiagramType => ({
        generics,
        name: DiagramTypeName.LINK,
        className: targetName,
    }),

    /**
     * Array of links to entity
     * @param targetName - entity name
     */
    LinkArray: (targetName: string): DiagramType => ({name: DiagramTypeName.LINK, className: targetName, array: true}),
    // Observable: AdvancedDiagramType.Observable,
};

export function DiagramTypeToString(type: DiagramType): string {
    const generics = (): string => {
        if (!type.generics?.length) {
            return "";
        }

        return `<${type.generics.map(DiagramGenericToString).join(", ")}>`;
    };


    if (Array.isArray(type.enumValues)) {
        const joinedEnumValues = type.enumValues.join(" | ");

        if (joinedEnumValues.length === 1) {
            return type.array ? `${joinedEnumValues}[]` : joinedEnumValues;
        }

        return type.array ? `(${joinedEnumValues})[]` : joinedEnumValues;
    }

    const realName = type.name === DiagramTypeName.LINK ? type.className : type.name;
    const typeName = realName + generics();

    if (typeName.match(/[< |]/)) {
        return type.array ? `(${typeName})[]` : typeName;
    }

    return type.array ? `${typeName}[]` : typeName;
}

export function ParseDiagramType(rawType: string): DiagramType {
    const trimmedType = rawType?.trim().replace(/[;]/g, "");
    if (!trimmedType) {
        return DiagramType.Unknown;
    }
    const isArray = trimmedType?.endsWith("[]");

    if (trimmedType.match(/void([ \t])*($|\n)/i)) {
        return DiagramType.Void;
    }
    if (trimmedType.match(/unknown(\[]| |\t)*($|\n)/i)) {
        return isArray ? DiagramType.UnknownArray : DiagramType.Unknown;
    }
    if (trimmedType.match(/string(\[]| |\t)*($|\n)/i)) {
        return isArray ? DiagramType.StringArray : DiagramType.String;
    }
    if (trimmedType.match(/number(\[]| |\t)*($|\n)/i)) {
        return isArray ? DiagramType.NumberArray : DiagramType.Number;
    }
    if (trimmedType.match(/boolean(\[]| |\t)*($|\n)/i)) {
        return isArray ? DiagramType.Boolean : DiagramType.Boolean;
    }

    return isArray ? DiagramType.LinkArray(trimmedType.replace("[]", "")) : DiagramType.Link(trimmedType);
}

import {DiagramType, DiagramTypeToString} from "./diagram-type";

export interface DiagramGeneric {
    readonly name: string;
    readonly extends?: DiagramType;
    readonly defaultValue?: DiagramType;
}

export function DiagramGenericToString(generic: DiagramGeneric): string {
    return [
        generic.name,
        generic.extends ? `extends ${DiagramTypeToString(generic.extends)}` : "",
        generic.defaultValue ? `= ${DiagramTypeToString(generic.defaultValue)}` : "",
    ].filter((e) => e).join(" ");
}

import {DiagramAccessModifier} from "./common/diagram-access-modifier";
import {DiagramElementType} from "./common/diagram-element-type";
import {DiagramGeneric} from "./common/diagram-generic";
import {DiagramType} from "./common/diagram-type";
import {DiagramClass} from "./entity/diagram-class";
import {DiagramEntity} from "./entity/diagram-entity";
import {DiagramEntityType} from "./entity/diagram-entity-type";
import {DiagramEnum} from "./entity/diagram-enum";
import {DiagramInterface} from "./entity/diagram-interface";
import {DiagramMethod} from "./method/diagram-method";
import {DiagramMethodParameter} from "./method/diagram-method-parameter";
import {DiagramProperty} from "./property/diagram-property";

const defaultAccess = DiagramAccessModifier.PUBLIC;

export class DiagramEntityFactory<T extends DiagramEntity> {
    private readonly properties: DiagramProperty[] = [];
    private readonly methods: DiagramMethod[] = [];
    private parentExtend?: DiagramType;
    private parentImplements: DiagramType[] = [];
    private readonly generics: DiagramGeneric[] = [];
    private access: DiagramAccessModifier = defaultAccess;
    private abstract = false;

    public constructor(
        private readonly type: DiagramEntityType,
        private readonly name: string,
    ) {
    }

    public static createClass(name: string): DiagramEntityFactory<DiagramClass> {
        return new DiagramEntityFactory(DiagramEntityType.CLASS, name);
    }

    public static createEnum(name: string): DiagramEntityFactory<DiagramEnum> {
        return new DiagramEntityFactory(DiagramEntityType.ENUM, name);
    }

    public static createInterface(name: string): DiagramEntityFactory<DiagramInterface> {
        return new DiagramEntityFactory(DiagramEntityType.INTERFACE, name);
    }

    public addPropertyRaw(property: Omit<DiagramProperty, "elementType">): this {
        this.properties.push(
            Object.assign(property, {elementType: DiagramElementType.PROPERTY}) as DiagramProperty,
        );

        return this;
    }

    public setParentExtends(parent: string): void {
        this.parentExtend = DiagramType.Link(parent);
    }

    public addParentImplements(parent: string): void {
        if (this.type !== DiagramEntityType.CLASS) {
            throw new Error("Only class cen implements objects");
        }
        this.parentImplements.push(DiagramType.Link(parent));
    }

    public addGenerics(...generics: DiagramGeneric[]): this {
        this.generics.push(...generics);

        return this;
    }

    public setAbstract(abstract: boolean): this {
        this.abstract = abstract;

        return this;
    }

    public addProperty(
        name: string,
        type: DiagramType,
        access: DiagramAccessModifier,
        options?: Pick<DiagramProperty, "static" | "final" | "optional" | "abstract" | "defaultValue">,
    ): this {
        return this.addPropertyRaw(
            Object.assign({}, options, {name, type, access}) as DiagramProperty,
        );
    }

    public addPrivateProperty(name: string, type: DiagramType, defaultValue?: string): this {
        return this.addProperty(name, type, DiagramAccessModifier.PRIVATE, {defaultValue} as any);
    }

    public addPublicProperty(name: string, type: DiagramType, defaultValue?: string): this {
        return this.addProperty(name, type, DiagramAccessModifier.PUBLIC, {defaultValue} as any);
    }

    public addPublicFinalProperty(name: string, type: DiagramType, defaultValue?: string): this {
        return this.addProperty(name, type, DiagramAccessModifier.PUBLIC, {defaultValue, final: true} as any);
    }

    public addMethodRaw(method: Omit<DiagramMethod, "elementType">): this {
        this.methods.push(
            Object.assign(method, {elementType: DiagramElementType.METHOD}) as DiagramMethod,
        );

        return this;
    }

    public addMethod(
        name: string,
        returnType: DiagramType,
        access: DiagramAccessModifier,
        parameters: DiagramMethodParameter[],
        options?: Pick<DiagramMethod, "static" | "final" | "optional" | "abstract">,
    ): this {
        return this.addMethodRaw(
            Object.assign({}, options, {name, access, returnType, parameters}) as unknown as DiagramMethod,
        );
    }

    public addPublicGenericMethod(name: string, returnType: DiagramType, generics: DiagramGeneric[], ...parameters: DiagramMethodParameter[]): this {
        return this.addMethodRaw({
            name,
            returnType,
            parameters,
            generics,
            access: DiagramAccessModifier.PUBLIC,
        });
    }

    public addPublicMethod(name: string, returnType: DiagramType, ...parameters: DiagramMethodParameter[]): this {
        return this.addMethod(name, returnType, DiagramAccessModifier.PUBLIC, parameters);
    }

    public addPrivateMethod(name: string, returnType: DiagramType, ...parameters: DiagramMethodParameter[]): this {
        return this.addMethod(name, returnType, DiagramAccessModifier.PRIVATE, parameters);
    }

    public build(): T {
        switch (this.type) {
            case DiagramEntityType.CLASS:
                return this.buildClass() as unknown as T;
            case DiagramEntityType.INTERFACE:
                return this.buildInterface() as unknown as T;
            case DiagramEntityType.ENUM:
                return this.buildEnum() as unknown as T;
            default:
                throw new Error("Cannot build entity with type " + this.type);
        }
    }

    private buildClass(): DiagramClass {
        return {
            elementType: DiagramElementType.ENTITY,
            name: this.name,
            access: this.access || defaultAccess,
            type: DiagramEntityType.CLASS,
            properties: this.properties,
            methods: this.methods,
            generics: this.generics,
            abstract: this.abstract,
            parentExtend: this.parentExtend,
            parentImplements: this.parentImplements,
        };
    }

    private buildEnum(): DiagramEnum {
        return {
            elementType: DiagramElementType.ENTITY,
            name: this.name,
            access: this.access || defaultAccess,
            type: DiagramEntityType.ENUM,
            properties: this.properties,
        };
    }

    private buildInterface(): DiagramInterface {
        return {
            elementType: DiagramElementType.ENTITY,
            name: this.name,
            access: this.access || defaultAccess,
            type: DiagramEntityType.INTERFACE,
            properties: this.properties,
            methods: this.methods,
            generics: this.generics,
            parentExtend: this.parentExtend,
        };
    }
}
